    const contentStyle = {
        height: '560px',

        background: '#fff',
    };
    return (
        <>
            <Row>
                <Col className="content" span={24} xs={{ order: 2 }} sm={{ order: 1 }} md={{ order: 4 }} lg={{ order: 3 }}>
                    <p >Hãy quyên góp cho những hoạt động mà bạn quan tâm</p>
                </Col>
            </Row>

        </>
    );
}

export default Home;
